  false,\n\t\"url\": null,\n\t\"notes\": \"The report covers the program to monitor
  the status of deer on Holla Bend National Wildlife Refuge since 1985. This program
  is run by the Fisheries and Wildlife Biology Program at Arkansas Tech University
  and Holla Bend NWR. This report discusses the results of monitoring population density,
  physical condition, and productivity. Biological data are collected from hunter-harvested
  deer at the Refuge check station.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
